  "source": "pragma solidity ^0.4.0;\n\nimport \"./SafeMath.sol\";\nimport \"./strings.sol\";\n\ncontract TokenERC20 {\n    function totalSupply()  view returns (uint);\n    function balanceOf(address _addr) view returns (uint);\n    function getTokenPrice() view returns (uint);\n    function approve(address _spender, uint256 _tokens) public returns (bool success) ;\n    function transfer(address _to, uint _tokens)  ;\n    function transferfrom(address _from, address _to, uint _tokens) public returns (bool success);\n    function spendToken(uint _tokens, address _consumerGatewayID) ;\n    function buyToken( uint _tokens, address _consumerGatewayID) payable ;\n    function approveAndCall(address _spender, uint256 _value, bytes _extraData) public returns (bool success);\n    function burn(uint256 _value) public returns (bool success) ;\n    function burnFrom(address _from, uint256 _value) public returns (bool success);\n}\n\ncontract AccessManagerERC20\n{\n  using SafeMath for uint;\n  using strings for *;\n\nstruct consumeID{\n    address consumerGatewayID;\n    string serviceConsumerID;\n}\n\nmapping(address => address) public ERC20ContractMapping;\n\naddress private owner;\nTokenERC20 mytoken;\nmapping(address=>consumeID[]) public pendingAccessRequests;\n\nmodifier callerCheck(address _ProducerGatewayID){\nrequire(msg.sender == _ProducerGatewayID);\n_;\n}\n\nmodifier onlyTokenOwner(address _gatewayID){\nrequire(msg.sender == _gatewayID);\n_;\n}\n\nmodifier checkERC20Balance(uint _tokens, address _consumerGatewayID, address _producerGatewayID) {\nmytoken = TokenERC20(ERC20ContractMapping[_producerGatewayID]);\nrequire(mytoken.balanceOf(_consumerGatewayID) >= _tokens);\n_;\n}\n\nfunction AccessManagerERC20()\n{\n  owner = msg.sender;\n}\n\nevent getAccessERC20Event(string _consumerCloudID, address indexed _consumerGatewayID, string _serviceConsumerID, string _producerCloudID, address indexed _producerGatewayID, string _serviceProducerID);\n\nevent grantAccessERC20Event(string token, string _consumerCloudID, address indexed _consumerGatewayID, string _serviceConsumerID, string _producerCloudID, address indexed _producerGatewayID, string _serviceProducerID);\n\nfunction addERC20ContractMapping(address _gatewayID, address _ERC20ContractAddress) public onlyTokenOwner(_gatewayID)\n{\n  ERC20ContractMapping[_gatewayID] = _ERC20ContractAddress;\n}\n\nfunction getERC20Balance(address _consumerGatewayID, address _producerGatewayID) public view returns(uint)\n{\nmytoken = TokenERC20(ERC20ContractMapping[_producerGatewayID]);\n    return   mytoken.balanceOf(_consumerGatewayID);\n}\n\nfunction getAccessERC20(string _consumerCloudID, address _consumerGatewayID, string _serviceConsumerID, string _producerCloudID, address _producerGatewayID, string _serviceProducerID, uint _tokens) public onlyTokenOwner(_consumerGatewayID) {\n  mytoken = TokenERC20(ERC20ContractMapping[_producerGatewayID]);\n  mytoken.transferfrom(_consumerGatewayID, _producerGatewayID, _tokens);\n  getAccessERC20Event(_consumerCloudID, _consumerGatewayID, _serviceConsumerID, _producerCloudID, _producerGatewayID, _serviceProducerID);\n  pendingAccessRequests[_producerGatewayID].push(consumeID(_consumerGatewayID, _serviceConsumerID));\n\n}\n\nfunction grantAccessERC20(string _authToken,string _consumerCloudID, address _consumerGatewayID, string _serviceConsumerID, string _producerCloudID, address _producerGatewayID, string _serviceProducerID) public callerCheck(_producerGatewayID)\n{\n  grantAccessERC20Event(_authToken, _consumerCloudID, _consumerGatewayID, _serviceConsumerID, _producerCloudID, _producerGatewayID, _serviceProducerID);\n  uint i;\n  uint arrayLen =  pendingAccessRequests[_producerGatewayID].length;\n  for(i = 0; i < arrayLen ;i++)\n  {\n    if(pendingAccessRequests[_producerGatewayID][i].consumerGatewayID == _consumerGatewayID && compareStrings(pendingAccessRequests[_producerGatewayID][i].serviceConsumerID, _serviceConsumerID)) {\n    pendingAccessRequests[_producerGatewayID][i] = pendingAccessRequests[_producerGatewayID][arrayLen -1];\n    delete(pendingAccessRequests[_producerGatewayID][arrayLen -1]);\n    pendingAccessRequests[_producerGatewayID].length--;\n    }\n  }\n}\n\nfunction compareStrings(string s1, string s2) internal returns(bool)\n{\nvar slice1 = s1.toSlice();\nvar slice2 = s2.toSlice();\nvar result = slice1.compare(slice2);\nif(result == 0)\nreturn true;\nelse\nreturn false;\n}\n}\n",
